import React from 'react';
import logoImage from '../assets/logo.png';

const Logo = () => {
  return (
    <div className="flex items-center">
      <img src={logoImage} alt="Yves Programmeur Logo" className="h-10 mr-2" />

    </div>
  );
};

export default Logo;
